css:
.nuclide-ui-message {
  border: 1px solid rgba(0, 0, 0, 0.5);
  border-radius: 2px;
  margin: 5px;
  padding: 10px;
  border-left-width: 5px;
  line-height: 2;
}
.nuclide-ui-message-default {
  border-color: #747369;
}
.nuclide-ui-message-error {
  color: #f2777a;
  border-color: #f2777a;
}
.nuclide-ui-message-info {
  color: #6699cc;
  border-color: #6699cc;
}
.nuclide-ui-message-success {
  color: #99cc99;
  border-color: #99cc99;
}
.nuclide-ui-message-warning {
  color: #f99157;
  border-color: #f99157;
}
